import { NextPage } from 'next';

const Index: NextPage = () => {
    return (
        <div>
            <div className="intro-container">
                <div className="intro-text-container">
                    <h1 className="intro-text">
                        Sculptures
                    </h1>
                    <h1 className="intro-text">
                        by Anita
                    </h1>
                </div>
            </div>
        </div>
    );
};

export default Index;
